        <div id="page2">
            <h1 class="title">About</h1>
            <div class="pContent">
                <div id="page2Txt">We are CYBER SENTINEL, Guardians of the Cyber world, a community entirely dedicated to cyber security.<br><br>
                UPES-CYBER SENTINEL came into existence on 28th January 2020, on the occasion of International Data Privacy Day. With a vision to facilitate students in their Cyber Security endeavors through extracurricular activities, mentoring and adhering to the Cyber Security Trends, and making them cyber aware. We conduct CTFs, Workshops, Talks, Challenges, Solutions, and guidance as a team of cyber security enthusiasts.A crew of the next generation attackers and defenders bent on building up the toughest armors in cyber warfare.</div>
                <div id="shieldDiv"></div>
            </div>
